import React from 'react'
import NavMubar from 'views/navbar/index'
import {
    Card,
    Container,
    Row,
    Col,
  } from "reactstrap";
  import './index.css'

import LeftSiderBar from 'views/leftSiderBar/index.js'

function MainLayout() {
    React.useEffect(() => {
        document.body.classList.add("login-page");
        document.body.classList.add("sidebar-collapse");
        document.body.classList.add("sidebarColor");
        document.documentElement.classList.remove("nav-open");
        window.scrollTo(0, 0);
        document.body.scrollTop = 0;
        return function cleanup() {
          document.body.classList.remove("login-page");
          document.body.classList.remove("sidebar-collapse");
          document.body.classList.remove("sidebarColor");
        };
      }, []);
    return(
        <>
      <NavMubar />
      <div className=" clear-filter" >
        <div className="content">
              <Row>
              <Col className=" singInHeader_layout" xs={12} sm={6} md={4}>
                  <LeftSiderBar />
              </Col>
              <Col className="singIn_layout "xs={12} sm={3} md={4}>
                  1
            </Col>
            <Col className="singIn_layout "  xs={12} sm={3} md={4}>
              3
            </Col>
            </Row>
        </div>
          {/* footer */}
      </div>
        </>
    )

}

export default MainLayout;
